export default `
@font-face {
  font-family: 'Fraunces';
  font-style: normal;
  font-weight: 400;
  src: url(fonts/Fraunces-Regular.ttf) format('ttf');
}
@font-face {
  font-family: 'My Heading Font';
  font-style: italic;
  font-weight: 400;
  font-display: swap;
  src: url(fonts/MyHeadingItalic.woff2) format('woff2');
  url(fonts/MyHeadingItalic.woff) format('woff');
  url(fonts/MyHeadingItalic.eot) format('eot');
  unicode-range: U+0000-00FF, U+0131, U+0152-0153, U+02BB-02BC, U+02C6, U+02DA, U+02DC, U+2000-206F, U+2074, U+20AC, U+2122, U+2191, U+2193, U+2212, U+2215, U+FEFF, U+FFFD;
}
`;
